■商品説明 <br />一つで使っても、シリーズで自由に積み重ねても使えるフラップ収納のフルセットです。使い方はお客様次第のお洒落な収納です。<br /><br />■本体サイズ<br />[外寸]<br /> [1P]幅37.0×奥行46.0×高さ42.0cm<br /> [2P]幅72.0×奥行46.0×高さ42.0cm<br /> [3P]幅107×奥行46.0×高さ42.0cm<br /> [キャスター]高さ5.3cm<br /><br />■その他サイズ<br />[内寸]<br /> （扉内）幅33×奥行33.5×高さ32.5cm<br /> （扉サイズ）幅32.5×奥行3.0×高さ38cm<br /><br />■材質<br />[本体]プリント化粧繊維板<br /><br />■収納量・耐荷重<br /><br /><br />■備考<br />・背面化粧有り<br /> ・キャスター4個（うちストッパー付2個）<br /><br />■生産国<br />ベトナム<br /><br />■組立時間(目安)(大人2人)<br />お客様組立（80分）<br /><br />■キーワード<br />スタッキングフラップ 積み重ね スタッキング フラップ扉 リビング収納<style>

